import React from "react";

const SideNavbar = () => {
  return (
    <div className="flex flex-col gap-4 p-2">
      <div>About</div>
      <div>Education</div>
      <div>Experience</div>
      <div>Projects</div>
      <div>Skills</div>
      <div>Achivement</div>
    </div>
  );
};

export default SideNavbar;
